package main

import (
	"testing"
)

func TestExample(t *testing.T) {
	watchedVideos := [][]string{{"A", "B"}, {"C"}, {"B", "C"}, {"D"}}
	friends := [][]int{{1, 2}, {0, 3}, {0, 3}, {1, 2}}
	id := 0
	level := 2

	expected := []string{"D"}
	given := watchedVideosByFriends(watchedVideos, friends, id, level)

	if len(given) > 1 || given[0] != expected[0] {
		t.Errorf("%v given but %v expected for %v %v %d %d", given, expected, watchedVideos, friends, id, level)
	}
}

func TestThird(t *testing.T) {
	watchedVideos := [][]string{{"bjwtssmu"}, {"aygr", "mqls"}, {"vrtxa", "zxqzeqy", "nbpl", "qnpl"}, {"r", "otazhu", "rsf"}, {"bvcca", "ayyihidz", "ljc", "fiq", "viu"}}
	friends := [][]int{{3, 2, 1, 4}, {0, 4}, {4, 0}, {0, 4}, {2, 3, 1, 0}}
	id := 3
	level := 1

	expected := []string{"ayyihidz", "bjwtssmu", "bvcca", "fiq", "ljc", "viu"}
	given := watchedVideosByFriends(watchedVideos, friends, id, level)

	if len(given) != len(expected) {
		t.Errorf("%v given but %v expected for %v %v %d %d", given, expected, watchedVideos, friends, id, level)
	}

	for i, v := range expected {
		if v != given[i] {
			t.Errorf("%v given but %v expected for %v %v %d %d", given, expected, watchedVideos, friends, id, level)
			return
		}
	}
}

